import React, { useState,useEffect } from "react";
import "./Main.css";
import styled from "styled-components";
import Doughnut from "./Doughnut";
import { getData , centerVisualization } from "./api/Look.js";
const MainLogo = styled.div`
  display: flex;
  align-items: center;
  img {
    width: 56px;
    height: 55px;
    margin-top: 10px;
  }
  margin-top: 20px;
  margin-left: 20px;
`;

const Main = () => {
  let east,west,north,south,total_revenue,Mahindra,Maruthi,Tata
  const [data, Data] = useState([]);
  const [zonedata, setData] = useState([]);

  useEffect(() => {
    const fetchData1 = async () => {
      try {
        const result = await getData();
        Data(result.success);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData1();
  }, []);


  useEffect(() => {
    const fetchData2 = async () => {
      try {
        const result = await centerVisualization();
        setData(result.success);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData2();
  }, []);


  const [selectedData, setSelectedData] = useState("2021");

  const selectyearhandler = (event) => {
    setSelectedData(event.target.value);
  };
  localStorage.setItem("selectedyear", selectedData);
  return (
    
    <>
      <div className="main">
        <div className="circle">
          <div className="circle-2">
            <div class="timeline2">
              <div class="outers">
                <div class="cards">
                  <div class="info1">
                    <p class="title" style={{ whiteSpace: "nowrap" }}>
                      Total sale
                    </p>
                    {
                      
                      data.filter(
                        (item) =>
                          item["all_data_iter_4.date_year"] === 2022
                      ).map((item, index) => {
                        switch(item["all_data_iter_4.company"]){
                          case "Mahindra":
                            Mahindra=item["all_data_iter_4.total_revenue"].toFixed(2)
                            break
                          case "Maruthi":
                            Maruthi=item["all_data_iter_4.total_revenue"].toFixed(2)
                            break
                          case "Tata":
                            Tata=item["all_data_iter_4.total_revenue"].toFixed(2)
                            break
                        }})}

                    {
                      
                    zonedata.filter(
                      (item) =>
                        item["all_data_iter_4.date_year"] === 2022
                    ).map((item, index) => {
                      switch(item["all_data_iter_4.zone"]){
                        case "East":
                          east=item["all_data_iter_4.total_revenue"].toFixed(2)
                          break
                        case "West":
                           west=item["all_data_iter_4.total_revenue"].toFixed(2)
                           break
                        case "North":
                          north=item["all_data_iter_4.total_revenue"]
                          break
                        case "South":
                          south=item["all_data_iter_4.total_revenue"]
                          break
                      }
                      total_revenue = east+west+north+south
                      })
                      }
                    <h3 style={{ whiteSpace: "nowrap" }}>{total_revenue} Cr</h3>
                  </div>
                </div>
                <div class="cards">
                  <div class="info1">
                    <p class="title" style={{ whiteSpace: "nowrap" }}>Eastern zone</p>
                      
                    
                    <h3 style={{ whiteSpace: "nowrap" }}>{east} Cr</h3>
                  </div>
                </div>
                <div class="cards">
                  <div class="info1">
                    <p class="title" style={{ whiteSpace: "nowrap" }}>
                      Western Zone
                    </p>
        
                    <h3 style={{ whiteSpace: "nowrap" }}>{west} Cr</h3>
                  </div>
                </div>
                <div class="cards">
                  <div class="info1">
                    <p class="title" style={{ whiteSpace: "nowrap" }}>
                      Northern Zone
                    </p>
    
                    <h3 style={{ whiteSpace: "nowrap" }}>{north} Cr</h3>
                  </div>
                </div>
                <div class="cards">
                  <div class="info1">
                    <p class="title" style={{ whiteSpace: "nowrap" }}>
                      Southern Zone
                    </p>
              
                    
                    <h3 style={{ whiteSpace: "nowrap" }}>{south
                    } Cr</h3>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div className="circle-3">
            <Doughnut />
          </div>

          <div className="circle-4">
            <div class="timeline">
              <div class="card1">
                <div class="info">
                  <p style={{ whiteSpace: "nowrap" }}>Mahindra</p>
                  <h3>{Mahindra} Cr </h3>
                </div>
              </div>
              <div class="card2">
                <div class="info">
                  <p style={{ whiteSpace: "nowrap" }}>Maruthi</p>
                  <h3>{Maruthi} Cr </h3>
                </div>
              </div>
              <div class="card3">
                <div class="info">
                  <p style={{ whiteSpace: "nowrap" }}>Tata</p>
                  <h3>{Tata} Cr </h3>
                </div>
              </div>

    
            </div>
          </div>
          <div className="circle-5">
            <MainLogo>
              <img src="/mm-logo.png" alt="logo" />
            </MainLogo>
          </div>
        </div>

        <div className="copyright">
          <p style={{ whiteSpace: "nowrap" }}>
            Copyright @ 2023 mahindra rise. All rights reserved.
          </p>
        </div>
      </div>
    </>
  );
};

export default Main;
